import PropTypes from 'prop-types'
import Buttons from './Buttons'

const Header = ({title, onClick,showAdd}) => {

    return (
        <header
        className="header">
        <h1>{title}</h1> 
        <Buttons onClick = {onClick}
                 color="green" text={showAdd ? "Add" : "Close"}/>
        </header>
    )
}

Header.defaultProps = {
    title : 'Task Tracker',
}

Header.propTypes = {
    title : PropTypes.string,
}
export default Header
